import React from 'react'
import { Col } from 'react-bootstrap'

function CardMovie() {
  return (
    <Col sm='6' md='4' lg='3' >
      <div className='card'>
        <img src='' alt='image' className='card_image' />
      </div>
    </Col>
  )
}

export default CardMovie
